import { Card, Row } from 'react-bootstrap';

const TypeBar = observer(() => {
    const { course } = useContext(Context)
    return (
        <ListGroup>
            <ListGroup.Item>Cras justo odio</ListGroup.Item>
        </ListGroup>
    );
});

export default TypeBar;
